import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  position: absolute;
  width: 1280px;
  height: 501px;
  left: 0px;
  top: 410px;

  background: linear-gradient(270deg, #19d9b4 -1.13%, #92d275 101.87%);
`;
